import React, { Component } from 'react';
import './crypto.css'

class crypto extends Component {
    constructor(props) {
        super(props);
        this.state = {
            data: [
                {
                    id: "bitcoin",
                    price: "10"
                },
                {
                    id: "ethereum",
                    price: "20"
                }
            ]
        }
    }
    render() {
        let crypto = this.state.data.map (
            (currency) => {
            <li key={currency.id}>
            <h3>{currency.id} </h3>
            <h4>$ {currency.price}</h4>
            </li>
            })
        // let crypto = this.state.data.map(
        //     (currency) => {

        //     })
        return (
            <div className="crypto-container">
                <ul className="crypto">{crypto}</ul>
            </div>
        )
    }
}
export default crypto
